[
  {
    "apiVersion": "camel.apache.org/v1",
    "kind": "Build",
    "metadata": {
      "labels": {
        "app": "camel-k"
      },
      "name": "example"
    },
    "spec": {}
  },
  {
    "apiVersion": "camel.apache.org/v1",
    "kind": "CamelCatalog",
    "metadata": {
      "labels": {
        "app": "camel-k"
      },
      "name": "example"
    },
    "spec": {}
  },
  {
    "apiVersion": "camel.apache.org/v1",
    "kind": "Integration",
    "metadata": {
      "labels": {
        "app": "camel-k"
      },
      "name": "example"
    },
    "spec": {
      "flows": [
        {
          "from": {
            "parameters": {
              "period": "1000"
            },
            "steps": [
              {
                "set-body": {
                  "constant": "Hello from Camel K"
                }
              },
              {
                "to": "log:info"
              }
            ],
            "uri": "timer:yaml"
          }
        }
      ]
    }
  },
  {
    "apiVersion": "camel.apache.org/v1",
    "kind": "IntegrationKit",
    "metadata": {
      "labels": {
        "app": "camel-k"
      },
      "name": "example"
    },
    "spec": {}
  },
  {
    "apiVersion": "camel.apache.org/v1",
    "kind": "IntegrationPlatform",
    "metadata": {
      "labels": {
        "app": "camel-k"
      },
      "name": "camel-k"
    },
    "spec": {
      "build": {},
      "kamelet": {},
      "profile": "OpenShift",
      "resources": {}
    },
    "status": {
      "build": {
        "maven": {
          "settings": {}
        },
        "registry": {}
      },
      "kamelet": {},
      "resources": {}
    }
  },
  {
    "apiVersion": "camel.apache.org/v1alpha1",
    "kind": "Kamelet",
    "metadata": {
      "labels": {
        "app": "camel-k"
      },
      "name": "example"
    },
    "spec": {
      "definition": {
        "description": "Produces periodic events with a custom payload",
        "properties": {
          "message": {
            "description": "The message to generate",
            "title": "Message",
            "type": "string"
          },
          "period": {
            "default": 1000,
            "description": "The time interval between two events",
            "title": "Period",
            "type": "integer"
          }
        },
        "required": [
          "message"
        ],
        "title": "Example Timer"
      },
      "template": {
        "from": {
          "parameters": {
            "period": "#property:period"
          },
          "steps": [
            {
              "set-body": {
                "constant": "#property:message"
              }
            },
            {
              "to": "kamelet:sink"
            }
          ],
          "uri": "timer:tick"
        }
      }
    }
  },
  {
    "apiVersion": "camel.apache.org/v1alpha1",
    "kind": "KameletBinding",
    "metadata": {
      "labels": {
        "app": "camel-k"
      },
      "name": "example"
    },
    "spec": {
      "sink": {
        "ref": {
          "apiVersion": "messaging.knative.dev/v1",
          "kind": "InMemoryChannel",
          "name": "example"
        }
      },
      "source": {
        "properties": {
          "message": "Hello world"
        },
        "ref": {
          "apiVersion": "camel.apache.org/v1alpha1",
          "kind": "Kamelet",
          "name": "example"
        }
      }
    }
  }
]

[
  {
    "apiVersion": "dbaas.redhat.com/v1alpha1",
    "kind": "DBaaSConnection",
    "metadata": {
      "name": "dbaasconnection-sample"
    },
    "spec": {
      "instanceID": "atlas-instance",
      "inventoryRef": {
        "name": "atlas-inventory",
        "namespace": "openshift-dbaas-operator"
      }
    }
  },
  {
    "apiVersion": "dbaas.redhat.com/v1alpha1",
    "kind": "DBaaSInstance",
    "metadata": {
      "name": "dbaasinstance-sample"
    },
    "spec": {
      "cloudProvider": "AWS",
      "cloudRegion": "US_EAST_1",
      "inventoryRef": {
        "name": "atlas-inventory",
        "namespace": "openshift-dbaas-operator"
      },
      "name": "my-cluster-free",
      "otherInstanceParams": {
        "instanceSizeName": "M0",
        "projectName": "my-atlas-project-free"
      }
    }
  },
  {
    "apiVersion": "dbaas.redhat.com/v1alpha1",
    "kind": "DBaaSInventory",
    "metadata": {
      "name": "atlas-inventory"
    },
    "spec": {
      "credentialsRef": {
        "name": "atlas-inventory-credentials"
      },
      "providerRef": {
        "name": "mongodb-atlas-registration"
      }
    }
  },
  {
    "apiVersion": "dbaas.redhat.com/v1alpha1",
    "kind": "DBaaSPlatform",
    "metadata": {
      "name": "dbaasplatform-sample"
    },
    "spec": {
      "syncPeriod": 180
    }
  },
  {
    "apiVersion": "dbaas.redhat.com/v1alpha1",
    "kind": "DBaaSProvider",
    "metadata": {
      "labels": {
        "related-to": "dbaas-operator",
        "type": "dbaas-provider-registration"
      },
      "name": "atlas-provider-registration"
    },
    "spec": {
      "allowsFreeTrial": true,
      "connectionKind": "MongoDBAtlasConnection",
      "credentialFields": [
        {
          "displayName": "Organization ID",
          "helpText": "You can find the Organization ID from the Organization Settings page on your MongoDB account home page.",
          "key": "organizationId",
          "required": true,
          "type": "string"
        },
        {
          "displayName": "Organization Public Key",
          "helpText": "You can find the Public API Key from the API Keys tab on the Organization Access Manager page from your MongoDB account home page.",
          "key": "publicApiKey",
          "required": true,
          "type": "string"
        },
        {
          "displayName": "Organization Private Key",
          "helpText": "You can find the Private API Key from the API Keys tab on the Organization Access Manager page from your MongoDB account home page.",
          "key": "privateApiKey",
          "required": true,
          "type": "maskedstring"
        }
      ],
      "instanceKind": "MongoDBAtlasInstance",
      "instanceParameterSpecs": [
        {
          "displayName": "Cluster Name",
          "name": "clusterName",
          "required": true,
          "type": "string"
        },
        {
          "displayName": "Atlas Project Name",
          "name": "ProjectName",
          "required": true,
          "type": "string"
        },
        {
          "defaultValue": "Shared",
          "displayName": "Cluster Type",
          "name": "clusterType",
          "required": false,
          "type": "string"
        },
        {
          "defaultValue": "AWS",
          "displayName": "Cloud Provider",
          "name": "providerName",
          "required": false,
          "type": "string"
        },
        {
          "defaultValue": "US_EAST_1",
          "displayName": "Cloud Region",
          "name": "regionName",
          "required": false,
          "type": "string"
        },
        {
          "defaultValue": "M0",
          "displayName": "Cluster Size Name",
          "name": "instanceSizeName",
          "required": false,
          "type": "string"
        }
      ],
      "inventoryKind": "MongoDBAtlasInventory",
      "provider": {
        "displayDescription": "Some nice description show to dev users in UX when selecting which provider from catalog.",
        "displayName": "MongoDB Atlas",
        "icon": {
          "base64data": "\u003cbase64-encoded image data\u003e",
          "mediatype": "image/png"
        },
        "name": "Red Hat DBaaS / MongoDB Atlas"
      }
    }
  }
]

[
  {
    "apiVersion": "atlas.mongodb.com/v1",
    "kind": "AtlasBackupPolicy",
    "metadata": {
      "name": "atlasbackuppolicy-sample"
    },
    "spec": {
      "id": "1",
      "items": [
        {
          "frequencyInterval": 6,
          "frequencyType": "WEEKLY",
          "id": "2",
          "retentionUnit": "DAYS",
          "retentionValue": 6
        }
      ]
    }
  },
  {
    "apiVersion": "atlas.mongodb.com/v1",
    "kind": "AtlasBackupSchedule",
    "metadata": {
      "name": "atlasbackupschedule-sample"
    },
    "spec": {
      "autoExportEnabled": true,
      "policies": [
        {
          "name": "atlas-default-backuppolicy",
          "namespace": "mongodb-atlas-system"
        },
        {
          "name": "atlas-default-backuppolicy2",
          "namespace": "mongodb-atlas-system"
        }
      ],
      "referenceHourOfDay": 10,
      "referenceMinuteOfHour": 10,
      "restoreWindowDays": 2
    }
  },
  {
    "apiVersion": "atlas.mongodb.com/v1",
    "kind": "AtlasDatabaseUser",
    "metadata": {
      "name": "my-database-user"
    },
    "spec": {
      "databaseName": "admin",
      "passwordSecretRef": {
        "name": "my-database-user-password"
      },
      "projectRef": {
        "name": "my-project"
      },
      "roles": [
        {
          "databaseName": "admin",
          "roleName": "readWriteAnyDatabase"
        }
      ],
      "username": "david"
    }
  },
  {
    "apiVersion": "atlas.mongodb.com/v1",
    "kind": "AtlasDeployment",
    "metadata": {
      "name": "my-atlas-deployment"
    },
    "spec": {
      "deploymentSpec": {
        "name": "test-deployment",
        "providerSettings": {
          "instanceSizeName": "M10",
          "providerName": "AWS",
          "regionName": "US_EAST_1"
        }
      },
      "projectRef": {
        "name": "my-project"
      }
    }
  },
  {
    "apiVersion": "atlas.mongodb.com/v1",
    "kind": "AtlasProject",
    "metadata": {
      "name": "my-project"
    },
    "spec": {
      "name": "Test Atlas Operator Project",
      "projectIpAccessList": [
        {
          "comment": "IP address for Application Server A",
          "ipAddress": "192.0.2.15"
        }
      ]
    }
  },
  {
    "apiVersion": "dbaas.redhat.com/v1alpha1",
    "kind": "MongoDBAtlasConnection",
    "metadata": {
      "name": "test-connection",
      "namespace": "my-namespace"
    },
    "spec": {
      "instanceID": "606b2ffbc9a90e310e642482",
      "inventoryRef": {
        "name": "test-inventory",
        "namespace": "mongodb-atlas-system"
      }
    }
  },
  {
    "apiVersion": "dbaas.redhat.com/v1alpha1",
    "kind": "MongoDBAtlasInstance",
    "metadata": {
      "name": "test-instance"
    },
    "spec": {
      "cloudProvider": "aws",
      "cloudRegion": "US_EAST_1",
      "inventoryRef": {
        "name": "test-inventory",
        "namespace": "mongodb-atlas-system"
      },
      "name": "my-cluster-free",
      "otherInstanceParams": {
        "instanceSizeName": "M0",
        "projectName": "my-atlas-project-free"
      }
    }
  },
  {
    "apiVersion": "dbaas.redhat.com/v1alpha1",
    "kind": "MongoDBAtlasInventory",
    "metadata": {
      "name": "test-inventory"
    },
    "spec": {
      "credentialsRef": {
        "name": "my-atlas-key",
        "namespace": "mongodb-atlas-system"
      }
    }
  }
]
